import Modal from 'react-modal';

function CustomModal( props ) {

    const customStyles = {
        content: {
          top: '50%',
          left: '50%',
          right: 'auto',
          bottom: 'auto',
          marginRight: '-50%',
          transform: 'translate(-50%, -50%)',
        },
      };
      
    return (
        <Modal 
            isOpen={props.isOpen}
        />
    )
}

export default CustomModal;
